Obtido por destilação, o MCT Vitafor possui rápida absorção e pode ser utilizado como fonte de gordura em dietas de baixa ingestão de carboidratos. Não possui sabor residual de Coco.

Apresentação:
• Frasco de 500mL.

Benefícios
Óleo de coco, fonte de Triglicerídeos de Cadeia Média;
Rápida absorção ;
Concentrado em ácido caprílico e cáprico;
Diferenciais
• Não tem sabor, podendo ser adicionado em preparações doces ou salgadas;
• Pode ser usado via oral ou enteral.

Ingredientes

• Polygoni Multiflori Radix 100%. Composição da cápsula: gelatina e água purificada.

Diferenciais

