Colagentek é um alimento à base de proteína que fornece a quantidade ideal de colágeno hidrolisado (que possui mais fácil absorção), com as vitaminas e minerais (percussores de colágeno) necessários para potencializar a formação natural do colágeno no organismo.

Benefícios
• Alimento fonte de proteína à base de colágeno;
• Contém vitaminas e minerais que promovem efeitos sinérgicos potencializando os benefícios nutricionais do colágeno hidrolisado;
• Pode ser utilizado nos intervalos das principais refeições como alimento proteico.

Diferenciais
• Contém 9g de proteína de colágeno hidrolisado por sachê por dose;
• Exclusiva formulação com precursores de colágeno;
• Contem mix de vitaminas e minerais;
• Versão Neutra livre de FODMAP´s;
• Alta concentração de glicina, aminoácido importante na formação do colágeno.

